    setIsSignIn(!isSignIn);
  }
  const singup=()=>{}
  return (
    <div className="container border border-black m-4 p-3">
      <Header onClick={onClick}/>
      {isSignIn ?<SignIn/>:<SingUp singupFunc={singup}/>}
    </div>
  );
}

export default App;
